import React from 'react';

function About() {
  const people = [
    { name: "John Doe", introduction: "Hi, I'm John! I love coding and exploring new technologies."},
    { name: "Jane Smith", introduction: "Hey there! I'm Jane, passionate about design and user experience."},
    { name: "Michael Johnson", introduction: "Hello, I'm Michael. I enjoy solving complex problems with elegant solutions."},
    { name: "Emily Brown", introduction: "Hi everyone! I'm Emily. I'm a nature enthusiast and an avid reader."},
    { name: "David Lee", introduction: "Greetings! I'm David, a music lover and amateur chef."},
    // Add more people as needed
  ];

  return (
    <div>
      <h1>About Us</h1>
      <p>Meet our awesome team:</p>
      <ul>
        {people.map(person => (
          <li key={person.name}>
            <strong>{person.name}</strong>: {person.introduction}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default About;
